import movies_requests from './movies_requests';
import Row from './Row';
function App() {

  const func = async () => {
    // const api_Key=`b1bcd518764c9ced91d1c21adad8eb44`;
    const response = await fetch(`${movies_requests.fetchActionMovies}`)
    const jsonresponse = response.json();
    console.log(jsonresponse);
  }
  func();

  return (
    <div>
      <h2>This is my netflix app</h2>
      <Row  title='Trending Now' url={`https://api.themoviedb.org/3${movies_requests.fetchActionMovies}`}/>
      <Row  title='Top Rated'/>
    </div>
  )
}

export default App
